
use brewmap;
drop table kakao;
CREATE TABLE `kakao`
(
	`store_code` VARCHAR(10) NOT NULL COMMENT '코드',
	`store_name` VARCHAR(50) NOT NULL COMMENT '상호',
    `store_category` VARCHAR(50) NOT NULL COMMENT '술집분류',
    `store_addr` VARCHAR(50) NOT NULL COMMENT '주소',
	`store_Oldaddr` VARCHAR(50) NOT NULL COMMENT '지번주소',
    `store_tel` VARCHAR(20) NOT NULL COMMENT '전화번호',
    `x` VARCHAR(50) NOT NULL COMMENT 'X',
    `y` VARCHAR(50) NOT NULL COMMENT 'Y',
    PRIMARY KEY ( `store_Code` )
);


